//Dialog Types
export enum DialogType {
  Dialog = "dialog",
  ConfirmDialog = "confirm_dialog",
}

export enum TemplateDisplayTypes {
  Desktop = "desktop",
  Mobile = "mobile",
}

export enum TemplateOrientationTypes {
  Portrait = "portrait",
  Landscape = "landscape",
}

export enum PanelCloseReasons {
  Close = "close",
  Cancel = "cancel",
}

export enum TreeActionTypes {
  AddItem = "AddItem",
  RenameItem = "RenameItem",
  CopyFrom = "CopyFrom",
}

export enum PageMenuTypes {
  Content = "content",
  Summary = "summary",
  Question = "question",
}

export enum TemplatePanelTypes {
  Standard = "standard",
  Switchable = "switchable",
}
